import { BrowserRouter, Routes, Router } from "react-router-dom";
import './App.css';
import 'bootstrap/dist/css/bootstrap.min.css';
import Home from "./components/Home";


function App() {
  return (
    <div className="App">
       <BrowserRouter> {/* This is unnecessary if already used in index.js */}
      <Routes>
        <Router path="/" element={<Home/>} />
      </Routes>
    </BrowserRouter>
    </div>
  );
}

export default App;
